// src/Footer.js
import React from 'react';

const Footer = () => (
  <footer className="footer">
    <p>Thank you for visiting our website</p>
    <div className="social-links">
      <a href="#">Facebook           </a> 
      <a href="#">Twitter            </a>
      <a href="#">LinkedIn</a>
    </div>
  </footer>
);

export default Footer;
